import logo from './logo.svg';
import youngjo from './assets/images/young.PNG'
import './App.css';
import BubbleChat from './components/speech_bubble';

function App() {
  return (
    <div className="App bg-black">
      <header className="">
        <img src={youngjo} className="App-logo" alt="logo" />
        <BubbleChat />
      </header>
    </div>
  );
}

export default App;
